CREATE TABLE IF NOT EXISTS `spell_visuals` (
	`ID` INT(11) UNSIGNED NOT NULL AUTO_INCREMENT,
    `SpellID` INT(11) NULL DEFAULT NULL,
	`DifficultyID` TINYINT(4) UNSIGNED NULL DEFAULT NULL,
	`SpellVisualID` INT(11) UNSIGNED NULL DEFAULT NULL,
	`Probability` FLOAT(12) NULL DEFAULT NULL,
	`Flags` TINYINT(4) UNSIGNED NULL DEFAULT NULL,
	`Priority` TINYINT(4) UNSIGNED NULL DEFAULT NULL,
	`SpellIconFileID` INT(11) NULL DEFAULT NULL,
	`ActiveIconFileID` INT(11) NULL DEFAULT NULL,
	`ViewerUnitConditionID` SMALLINT(6) UNSIGNED NULL DEFAULT NULL,
	`ViewerPlayerConditionID` INT(11) UNSIGNED NULL DEFAULT NULL,
	`CasterUnitConditionID` SMALLINT(6) UNSIGNED NULL DEFAULT NULL,
	`CasterPlayerConditionID` INT(11) UNSIGNED NULL DEFAULT NULL,
	PRIMARY KEY (`ID`, `SpellID`) USING BTREE
);


